    const {userEmail, username, userid} = useContext(AuthContext)

    return (
        <div className="profile">
            <div className="allGames-info">
                <h6>Email: {userEmail}</h6>
                <h6>Name: {username}</h6>
            </div>
            {/*<Link to={`/profile/${userid}`} className="button">Edit</Link>*/}

        </div>
    )
}
